import { useEffect } from "react";
import { useSelector } from "react-redux";

import Products from "../components/Jewelry/Products";
import dummy_products from "../assets/dummy_products";
import Cart from "../components/Cart/Cart";

const JewelryPage = () => {
  const showcart = useSelector((state) => state.ui.cartIsVisible);

  fetch(() => {
    const fetchJewelry = async () => {
      await fetch(
        "https://react-app-9c2a2-default-rtdb.europe-west1.firebasedatabase.app/jewelry.json"
      ).then();
    };
  }, []);

  return (
    <div>
      {showcart && <Cart />}
      <Products list={dummy_products} />
    </div>
  );
};

export default JewelryPage;
